import logo from './logo.svg';
import './App.css';
import Hero from './hero';
import Body from './body';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World!
        </p>
        <Hero />
      </header>
      <Body />
    </div>
  );
}

export default App;
